import React from "react";
import { useState } from "react";
import axios from "axios";
import { useEffect } from "react";
import {  BrowserRouter ,Link,Router,  Routes,  Route,Switch } from "react-router-dom";
import Candels from './Candels'
import  Search  from "./Search";

function FetchSearch()

    {  var srch=""
       var tr=""
       const a=[1,2,23,4]
        var c=-1
        const [desc,setDes]=useState([])
        const [symbl,setSym]=useState([])
        const [sen,setSend]=useState([])
        var li=[]
        var lii=[]
        
        var x=1
        var y=[]
        const [name,Setname]=useState()
        const [lo,setlogo]=useState()
        const [exc,setexchange]=useState()
        const [url,seturl]=useState()
        const [phn,setphone]=useState()
        const [insdustry,setindusrty]=useState() 
        const [cp,currentp]=useState()
        const [symb,cs]=useState("aapl")
        function fetch(e)
        {
          srch=e.target.value
          
        }
        
        function Inn(prop)
        {
         tr=prop.sy
       
        axios
                .get(`https://finnhub.io/api/v1/search?q=${srch}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
        .then((response) =>
        {   var con=0
               const {count}= response.data
               while(con<count){
                
                const {description,symbol}= response.data.result[con]
               
                li.push(symbol)
                lii.push(description)
                setDes(lii)
                setSym(li)
                con=con+1
                setSend(a[2])
               }
                
        })
        
        axios
                .get(`https://finnhub.io/api/v1/stock/profile2?symbol=${symb}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
        .then((response) =>
        {
               const {name,logo,weburl,exchange,phone,finnhubIndustry}= response.data
                 Setname(name)
                 setlogo(logo)
                 setexchange(exchange)
                 setindusrty(finnhubIndustry)
                 setphone(phone)
                 seturl(weburl)
            
        })
        axios
        .get(`https://finnhub.io/api/v1/quote?symbol=${symb}&token=cjmeg19r01qmdd9puljgcjmeg19r01qmdd9pulk0`)
.then((response) =>
{
       const {c}= response.data
             currentp("price: $ "+ c)
    
})
    }
    ;
    srch=symbl[0]
    JSON.stringify(srch)
    console.log(typeof(srch))
        return(<>
        <input type="text" onChange={fetch}/>
        <button onClick={Inn}>G</button>
        <h1>{tr}</h1>
        {
            
           desc.map((x)=>{
            c=c+1
            
            return <a href="/candels/y" style={{color:"black",textDecoration:'none'}}><h1>name:{x}, symbol:{symbl[c]}</h1></a>
           })
            
  
            }


<BrowserRouter>
      <Routes>
      
          <Route path="candels" element={<Candels sy="fff" />} />
          {/* <Route path="search" element={<Search sy={li[0]}/>} /> */}
      </Routes>
    </BrowserRouter>
    <h1>{symbl[0]}</h1>
       </>)
       
    }
    export default FetchSearch
